" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Different patterns in the evolution of specific antibody and total immunoglobulin G (IgG) levels",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 389px; height: 673px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Time course of serum tetanus toxoid antibodies (blue) and IgG levels (red) in four patients (A and B in this figure; C and D in accompanying figure) demonstrating various patterns in the evolution of specific antibody and IgG levels. Black arrowheads represent immunization with tetanus and diphtheria toxoid, poliovirus and Bordetella pertussis. The area above the dashed line indicates normal levels of tetanus toxoid antibodies (&ge;0.05 IU/mL). A normal pattern is shown in which the ability to mount sustained specific antibody response precedes the normalization of total IgG levels (A) and parallels the normalization of serum IgG levels (B).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     From Dalal, I, Roifman, C. Humoral immunodeficiency. In: Immunology and Allergy Clin North Am 2001; 21:129.",
"    </div>",
